import React from 'react';
import './Centerpiece_Background.css'
function Centerpiece_Background(){
    return (
        <svg xmlns="http://www.w3.org/2000/svg" width="1420" height="406" viewBox="0 0 1420 406" fill="none">
            <path d="M84.5205 1L1 405H1363.03L1419.01 1H84.5205Z" fill="url(#paint0_linear_4_9)" stroke="black"/>
            <defs>
                <linearGradient id="paint0_linear_4_9" x1="710.007" y1="1" x2="710.007" y2="405" gradientUnits="userSpaceOnUse">
                    <stop stop-color="#A05FC9"/>
                    <stop offset="1" stop-color="#EF9039"/>
                </linearGradient>
            </defs>
        </svg>
    )
}

export default Centerpiece_Background;
